import React, { Component } from "react";
import "./App.css";
import Market from "./component/Market";
import Sell from "./component/Sell";
import Buy from "./component/Buy";

class App extends Component {
  render() {
    return (
      <div>
        <div class="row">
          <div class="column">
            Bitcoin Market
          </div>
          <div class="column">
          <Market />
          </div>
        </div>

        <div class="row">
          <div class="column">
            <Sell />
          </div>
          <div class="column">
            <Buy />
          </div>
        </div>
        <br/><br/><br/><br/>
      </div>
    );
  }
}
export default App;
